import Link from 'next/link';
import Head from 'next/head';
import Layout from './layout';

const styles = {
	fontFamily: 'monospace',
	fontSize: '50px',
	color: '#034172'
}
const button = {
	border: '1px solid #034172',
}

const Index = () => (
	<Layout>
		<div className="col-5 py-5 mx-auto">
			<div className="text-center">
				<h1 className="font-weight-bold" style={styles}>Weather Finder</h1>
				<div>
					<button type="button" className="btn btn-outline-info btn-lg">Login</button>
					<button type="button" className="btn btn-info btn-lg">Signup</button>
				</div>
			</div>
		</div>
	</Layout>
)

export default Index;
